import React, { Component } from 'react';

class VehicleDetails extends Component {

    render() {
        return (
                <div className="modal-body mx-4">
                    <div className="form-group">
                        <input type="text" className="form-control" placeholder="Vehicle Make" />
                    </div>
                    <div className="form-group">
                        <input type="text" className="form-control" placeholder="Vehicle Model" />
                    </div>
                    <div className="form-group">
                        <input type="text" className="form-control" placeholder="Variant Type" />
                    </div>
                    <div className="form-group">
                        <input type="text" className="form-control" placeholder="Manufacturing Year" />
                    </div>
                    <div className="form-group">
                        <input type="text" className="form-control" placeholder="Vehicle Value" />
                    </div>
                    <button type="submit" className="btn btn-primary" onClick={()=>this.props.changeCount('next')}>Next</button>
                </div>
        )
    }

}

export default VehicleDetails;
